import React, { Component } from 'react'

import './home.css'

export default class Home extends Component {
  render(){
    return(
      <div className = "container placement">
        <h1> Hi, I'm Fil. </h1>
        <br />
        <h4> I run bizdev at <a href = "pulley.com">Pulley</a>. I've been doing <a href = "/placeholder">judo</a> my entire life,  am an avid <a href = "placeholder">harmonica</a> player, and am trying to get better every day.</h4>
        <br />
        <h4>I run a <a href = "placeholder">blog</a>, a <a href = "placeholder">podcast</a>, and a bunch of <a href = "placeholder">products</a> to make my life easier. If you've got some feedback, ideas, or wanna use anything<a href = "contact">hmu</a>!</h4>
        <br />
        <h4>I put together this website to share how I'm trying to improve. If you wanna learn more about me, go <a href = "about">here</a>. If you wanna see what I'm working on, <a href = "projects">check it out</a>.</h4>
      </div>
      )
  }
}
